import Sidebar from '../Sidebar';
import './index.scss';

const Contact = () => {
    return (
        <div className='App'>
            <Sidebar />
            <div className='contact'>
                <h1>Contact Me</h1>
                <form id='contact-form'>
                    <ul></ul>
                </form>
            </div>
        </div>
    );
}

export default Contact;
